;(function(){
  if (window.VConsole!=undefined) {
    var vConsole = new VConsole();
  }
  let uri = new Uri(window.location.href)
  let topic = uri.host() + uri.path()
  topic = topic.replace(/\s/g,"").replace(/[^a-zA-Z0-9]/g,"_").toLowerCase()
  // console.log('topic', topic)
  const yunba = new Yunba({ appkey: '5bf812f01d14de0128123b3e' })
  yunba.init((success) => {
  // console.log('1.success', success)
  if (success) {
      yunba.connect((success, msg, sessionid) => {
      // console.log('2.success', success)
          yunba.subscribe({ 'topic': topic }, (success, msg) => {
              // console.log('3.success', success)
              // console.log('msg',JSON.stringify(msg))
              if (success) {
                  // console.log('' + topic)
                  let obj = {
                      topic: topic,
                      msg: JSON.stringify({
                          message: 'ready'
                      })
                  }
                  yunba.publish(obj, (success, msg)=>{
                      if(!success) {
                          console.log(msg)
                      }
                  })
                  yunba.set_message_cb((data)=>{
                      // console.log('set_message_cb', data)
                      if(topic == data.topic) {
                          let msg = JSON.parse(data.msg)
                          if(msg.command == 'refresh'){
                              window.location.reload()
                          }else if(msg.command == 'forward'){
                              window.history.go(1)
                          }else if(msg.command == 'back'){
                              window.history.go(-1)
                          }
                      }
                  })
              } else {
                  console.log('' + msg)
              }
          })
      })
  }
  })
})();
